import './App.css';
import { BrowserRouter,Routes,Route,NavLink } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <div className="NavBarLogo">
        <h1><span className="rotateLogo">The</span> Siren</h1>
        <nav>
          <NavLink to="/">Home</NavLink>
        </nav>
      </div>
      <Routes>
        <Route path="/"></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
